import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Text, Button, View, Alert, Image,TouchableOpacity } from 'react-native';
import {styles, buttons} from './style';
//import Navigator from './routes/homeStack';

export default function App() {
  const alertHandler = () => {
    Alert.alert('consumer pressed')
  }
  return (
    <View style={styles.container}>
      <Image
        source={require('./images/login.png')}
        style = {{width: 375, height: 375}}
      />
      <Text style={styles.logo}>
        Aged Care{"\n"}
        专注于老年人的远程服务
      </Text>
      <View style={styles.buttonContainer}>
        <TouchableOpacity style={styles.consumerWrapper}>
          <Text class="onsite-text">我是消费者</Text>
        </TouchableOpacity>
        <TouchableOpacity style={styles.providerWrapper}>
          <Text class="onsite-text">我是服务者</Text>
        </TouchableOpacity>
      </View>
      <Image
        source={require('./images/logo.png')}
        style = {styles.img2}
      />
    </View>
  );
}
